import React, { Component } from "react";
import { connect } from "react-redux";
class AddProdct extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  handleSubmit = (e) => {
    this.setState();
  };
  render() {
    return (
      <div>
        <h3> Add Product</h3>
        <br />
        <br />
        <form onSubmit={this.handleSubmit}></form>
      </div>
    );
  }
}
export default connect()(AddProdct);
